import React from "react";
import { PointAndFigure } from "recharts/charts";
import pointAndFigureChartData from "./PointAndFigureData.json";

const PointAndFigureChartComponent = () => {
  return (
    <PointAndFigure width={500} height={300} data={pointAndFigureChartData} />
  );
};

export default PointAndFigureChartComponent;
